const getUsers = () => {
    return fetch("http://localhost:9000/users/")
    .then(res => res.text())    
    .then(res => res);
}

const createUser = user => {
    fetch("http://localhost:9000/users/new/andreas-tak@mak.com", {method: 'POST'})
        .then(res => res.text())
        .then(res => res);
}

module.exports = {
    getUsers,
    createUser
}
